import Footer from "../Components/Footer";
import { Header } from "../Components/Header";
import HomeImageSlider from "../Components/HomeImageSlider";

const Home = () => {
  return (
    <div>
      <Header />
      <HomeImageSlider />
      <Footer />
    </div>
  );
};

export default Home;
